import React from 'react';
import './App.css';
import Header from './Header'
import AddContact from './AddContact'
import ContactList from './ContactList'

function App(){
  const Lists = [
    {
      "name" : "rajesh",
      "email" : "rajesh@gmail.com",
    },
    {
      "name" : "Rajasthan",
      "email" : "rajasthan@gmail.com",
    }
  ]
  return (
    <div>
      <Header />
      <AddContact Fu/>
      <ContactList Contacts = {Lists}/>
    </div>
  );
}

export default App;
